import React from "react"

function Heading() {
  return <div className="heading">
    <h1>To-Do List</h1>
  </div>
}



function Listitem(props) {

  let checked = false

  const [count, setCount] = React.useState(false)

  function isChecked() {
    setCount(preValue => {
      return !preValue
    })
  }
  return setCount(<li style={{ "textDecoration": count ? "line-through" : "none" }} onClick={isChecked}>{props.text}</li>)
}


export { Heading, Listitem }
